import React from 'react';
import "./popupScreen.css";

function PopupScreen(props) {

const togglePopup = () => {
    console.log('sdflasjflkasdf');
    props.setShowPopup(!props.showPopup);
}

  return (
    <div>
        <div className="popup-screen d-flex col-12 flex-column justify-content-center align-items-center">
          <h2>Popup Screen</h2>
          <p>This is the content of the popup screen.</p>
          <button onClick={() => {togglePopup()}}>Close Popup</button>
        </div>
    </div>
  );
}

export default PopupScreen;
